function slipPage(url,data){var slip=$("#slip");slip.empty();if(data.total<=0){if(slip.hasClass("hide")==false){slip.addClass("hide")}return}slip.removeClass("hide");var previous="/1/10";var next="/1/10";var nowPage="/"+data.pageNum+"/10";if(data.hasNextPage==true){next="/"+(data.pageNum+1)+"/10"}if(data.hasPreviousPage==true){previous="/"+(data.pageNum-1)+"/10"}var slipString="<ul class='pagination' data-url='"+url+"'><li class='waves-effect' ><i class='material-icons' data-url='"+previous+"'>chevron_left</i></li><li class='waves-effect active'><a data-url='"+nowPage+"'>"+data.pageNum+"</a></li><li class='waves-effect'><i class='material-icons' data-url='"+next+"'>chevron_right</i></li></ul>";slip.append(slipString)}